import React, { Component } from 'react';


class RecruitProfile extends Component {
    constructor(props) {
        super(props)

    }

    render() {
        return (
            <div className="flex justify-between border border-gray-100">
                <div>{this.props.stars}</div>
                <div className="mx-5 text-lg">{this.props.recruit.name}</div>
                <div className="mx-5 text-lg">{this.props.recruit.position}</div>
                <div className="mx-5 text-lg">{this.props.recruit.height}</div>
            </div>
        )
    }
}

export default RecruitProfile;
